import React from "react";
import "./style.css";

const Navigation = () => {
  return (
    <div className="nav" id="nav">
      <button>About Us</button>
      <button>The Hands</button>
      <button>Feedback</button>
      <button>Register</button>
      <button>Log In</button>
    </div>
  );
};

export default Navigation;
